.equ STEP_SIZE, 4                  # Pixels to move per step
.equ POSE_CHANGE_STEPS, 4          # Steps before changing pose

    .word 0           # Offset 0: Unused
    .word 16          # Offset 4: Width (16 pixels)
    .word 16          # Offset 8: Height (16 pixels)

.text

li a0, 60    # Load x-coordinate (60) into a0
li a1, 140    # Load y-coordinate (60) into a1
la a2, smygol # Load address of sprite data into a2 (assuming "symgol" was a typo for "smygol")
li a3, 2     # Load frame/pose number (2) into a3
call PrintSprite # Call the PrintSprite function

li a0, 100
li a1, 50
la a2, smygol
li a3, 0
call PrintSprite

li a0, 100
li a1, 50
la a2, smygol
li a3, 0
call PrintSprite



# Main function: Game loop for sprite movement
main:
    # Initialize sprite state
    li s0, 40           # s0 = x position
    li s1, 40           # s1 = y position
    li s2, 0            # s2 = current pose (0, 1, 2)
    li s3, 0            # s3 = flip state (0 = normal, 1 = flipped)
    li s4, 0            # s4 = step counter for pose animation
    la s5, smygol       # s5 = sprite pointer
    lw s6, 4(s5)        # s6 = sprite width
    lw s7, 8(s5)        # s7 = sprite height

game_loop:
    # Save return address
    addi sp, sp, -4
    sw ra, 0(sp)

    # Reset movement flag
    li t2, 0            # t2 = moved flag

    # Check Up
    la t0, D_PAD_0_UP
    lw t1, 0(t0)        # Read up input
    beqz t1, check_right
    addi s1, s1, -STEP_SIZE  # Move up
    li t2, 1            # Set moved flag
    j update_pose

check_right:
    la t0, D_PAD_0_RIGHT
    lw t1, 0(t0)        # Read right input
    beqz t1, check_down
    addi s0, s0, STEP_SIZE   # Move right
    li s3, 1            # Not flipped
    li t2, 1            # Set moved flag
    j update_pose

check_down:
    la t0, D_PAD_0_DOWN
    lw t1, 0(t0)        # Read down input
    beqz t1, check_left
    addi s1, s1, STEP_SIZE   # Move down
    li t2, 1            # Set moved flag
    j update_pose

check_left:
    la t0, D_PAD_0_LEFT
    lw t1, 0(t0)        # Read left input
    beqz t1, boundary_check
    addi s0, s0, -STEP_SIZE  # Move left
    li s3, 0            # Flipped
    li t2, 1            # Set moved flag

update_pose:
    # Update pose if moved
    beqz t2, boundary_check
    addi s4, s4, 1      # Increment step counter
    srli t3, s4, 2      # t3 = step_count / 4
    andi s2, t3, 0x3    # s2 = (step_count / 4) % 3 (poses 0, 1, 2)

boundary_check:
    # Ensure x >= 0
    bgez s0, check_x_max
    li s0, 0

check_x_max:
    # Ensure x + width <= LED_MATRIX_0_WIDTH
    add t0, s0, s6      # t0 = x + width
    li t1, LED_MATRIX_0_WIDTH
    ble t0, t1, check_y
    sub s0, t1, s6      # x = max_x - width

check_y:
    # Ensure y >= 0
    bgez s1, check_y_max
    li s1, 0

check_y_max:
    # Ensure y + height <= LED_MATRIX_0_HEIGHT
    add t0, s1, s7      # t0 = y + height
    li t1, LED_MATRIX_0_HEIGHT
    ble t0, t1, draw
    sub s1, t1, s7      # y = max_y - height

draw:
    # Clear screen
    call ClearScreen

    # Draw sprite
    mv a0, s0           # posX
    mv a1, s1           # posY
    mv a2, s5           # sprite pointer
    mv a3, s2           # pose
    mv a4, s3           # flip state
    call PrintSprite

    # Short delay for smooth animation
    call delay

    # Restore return address
    lw ra, 0(sp)
    addi sp, sp, 4

    # Loop forever
    j game_loop

# Delay function: Controls animation speed
delay:
    li t0, 1000         # Delay count (adjust for desired speed)
delay_loop:
    addi t0, t0, -1
    bnez t0, delay_loop
    ret

# ClearScreen function: Clears the LED matrix
ClearScreen:
    # Save registers
    addi sp, sp, -8
    sw ra, 4(sp)
    sw t0, 0(sp)

    # Clear entire LED matrix
    la t0, LED_MATRIX_0_BASE
    li t1, LED_MATRIX_0_WIDTH
    li t2, LED_MATRIX_0_HEIGHT
    mul t1, t1, t2      # Total pixels = width * height
    slli t1, t1, 2      # Total bytes = pixels * 4
    add t1, t0, t1      # End address
    li t2, 0            # Black pixel (0x00000000)
clear_loop:
    sw t2, 0(t0)        # Write black pixel
    addi t0, t0, 4      # Next pixel
    blt t0, t1, clear_loop

    # Restore registers
    lw ra, 4(sp)
    lw t0, 0(sp)
    addi sp, sp, 8
    ret

# PrintSprite function: Renders the sprite on the LED matrix
PrintSprite:
    # Arguments:
    # a0: posX (top-left pixel)
    # a1: posY (top-left pixel)
    # a2: pointer to sprite
    # a3: pose number
    # a4: flipped? (0 = normal, non-zero = horizontally flipped)
    
    # Save registers
    addi sp, sp, -16
    sw ra, 12(sp)
    sw s0, 8(sp)
    sw s1, 4(sp)
    sw s2, 0(sp)
    
    # Load sprite dimensions
    lw t0, 4(a2)        # t0 = sprite width
    lw t1, 8(a2)        # t1 = sprite height
    
    # Move sprite pointer to pixel data
    addi a2, a2, 12     # Skip header (width, height)
    
    # Calculate offset for pose
    mul a3, a3, t0      # a3 = pose * width
    mul a3, a3, t1      # a3 = pose * width * height
    slli a3, a3, 2      # a3 = pose * width * height * 4 (bytes per pixel)
    add a2, a2, a3      # a2 = pointer to pose pixel data
    
    # Calculate LED matrix base address
    li t2, LED_MATRIX_0_WIDTH
    mul t2, t2, a1      # t2 = posY * matrix_width
    add t2, t2, a0      # t2 = posY * matrix_width + posX
    slli t2, t2, 2      # t2 = (posY * matrix_width + posX) * 4
    la t3, LED_MATRIX_0_BASE
    add t2, t2, t3      # t2 = LED matrix base address + offset
    
    # Set pixel step and row adjustment
    li a0, 4            # a0 = normal pixel step (4 bytes)
    li a1, LED_MATRIX_0_WIDTH
    sub a1, a1, t0      # a1 = matrix_width - sprite_width
    slli a1, a1, 2      # a1 = (matrix_width - sprite_width) * 4
    
    # Handle flipping
    beqz a4, no_flip    # If a4 == 0, skip flip adjustments
    li a0, -4           # Reverse pixel step for flipping
    addi t2, t2, -4     # Adjust t2 to start at right edge
    mul t3, t0, a0      # t3 = sprite_width * pixel_step
    add t2, t2, t3      # Move t2 to rightmost pixel of first row
    li a1, LED_MATRIX_0_WIDTH
    add a1, a1, t0      # a1 = matrix_width + sprite_width
    slli a1, a1, 2      # a1 = (matrix_width + sprite_width) * 4
    
no_flip:
    mv s0, t1           # s0 = remaining rows (height)
rowps:
    mv s1, t0           # s1 = remaining columns (width)
colps:
    lw t4, 0(a2)        # Load pixel data
    li t5, 0xff00ff00   # Transparency mask (e.g., green as transparent)
    and t4, t4, t5      # Check for transparent pixel
    beqz t4, nextPixel  # Skip if transparent
    
    # Construct RGB pixel (assuming 32-bit RGBA format)
    lbu t5, 0(a2)       # Red component
    slli t5, t5, 16     # Shift to red position
    or t4, t4, t5       # Combine
    lbu t5, 2(a2)       # Blue component
    or t4, t4, t5       # Combine
    
    sw t4, 0(t2)        # Store pixel to LED matrix
    
nextPixel:
    addi a2, a2, 4      # Next sprite pixel
    add t2, t2, a0      # Next matrix position (forward or backward)
    addi s1, s1, -1     # Decrement column counter
    bgtz s1, colps      # Loop until columns done
    
    # Adjust for next row
    add t2, t2, a1      # Move to next row
    addi s0, s0, -1     # Decrement row counter
    bgtz s0, rowps      # Loop until rows done
    
    # Restore registers and return
    lw ra, 12(sp)
    lw s0, 8(sp)
    lw s1, 4(sp)
    lw s2, 0(sp)
    addi sp, sp, 16
    ret